                        {element.state}
                    </li>
                    <li>{element.capital}</li>
                    </ul>
                    <div cla>
                    {element.language.map((onelang)=>(<span key={onelang}>{onelang}</span>))}
                    </div>
                    </div>

            )
        }
    )
    return (
        <div>
            {listItems}
        </div>
    )
}

